import React from "react";
import ReactDOM from "react-dom";
import "bootstrap/dist/css/bootstrap.css";

import "./global.css";
import Badge from "./components/Badge";

const container = document.getElementById("app");

ReactDOM.render(
  <Badge
    firtsName="Erick"
    lastName="Ruiz"
    JobTittle="Frontend developer"
    twitter="ErickRV19"
  />,
  container
);
